B.aIt=new A.n("This application does not adjust any individual widget properties. The theme is adjusted interactively and all Flutter widgets in it change as the application's theme is modified interactively.\n\nMaterial 3 ColorScheme is supported and can be generated using built-in scheme colors as ColorScheme seed keys. Like with ColorScheme.fromSeed, you can use the primary color as seed key. You can also include secondary and tertiary colors as key colors to generate your Material 3 ColorScheme. You can customize the tonal palette generation parameters. For branding purposes you can lock selected main colors to their defined input values, while branding wise less relevant colors are still seed generated.\n\nThe theming settings and their impact on widgets are shown in widget topic panels. The same panels are used on two screens with different layouts. The default one is a page view, where you see one topic at a time. The second screen is a large masonry grid view, where you can see many topics at once when using large screens. You can open and close topics to view more or fewer of them at the same time. The app is however primarily intended to be used on web based desktop browsers, or as a native Windows, Mac or Linux desktop app, where it shines.\n\nThe three first themes in the app are example custom color schemes, made in the tutorials with the API, they are not built-in choices in the package. In the package tutorials you learn how to make your own custom color schemes and turn them into advanced themes with FlexColorScheme. All settings in this demo are persisted locally and can be reset back to default values at any time. Feel free to experiment with interesting theme styles. If you get lost in options, just reset and start again.",null,null,null,null,null,null,null,null,null,null)
